export default function Home() {
  return (
    <div>


      <Card className="text-center">
  <Card.Header>Featured</Card.Header>
  <Card.Body>
    <Card.Title>Special title treatment</Card.Title>
<Card.Text>

<TypeWriterEffect
textStyle={{ fontFamily: 'Red Hat Display' }}
startDelay={100}
cursorColor="black"
